			.content_box {
				width: 100%;
				height: 100%;
				display: flex;
				flex-direction: column;
				align-items: center;
				justify-content: center;
				opacity: 1;

				overflow: hidden;

				flex-direction: column;
				align-items: center;

			.bottom_box > span {
				font-size: 15px;
				font-family: Source Han Sans CN;
				font-weight: 300;
				color: #FFFFFF;
			}

							window.location.href = "http://127.0.0.1:8900/root/User/mac/demo.html";
						}
					}
				});
			}
			var bar = window.setInterval(function() { go() }, 30);
			var status = window.setInterval(function () { getStatus() }, 3000)
			window.onload = function() {
				bar;
				status;
			}
		</script>
